import React from 'react';


const Repo = (props) => {
    const repo = props.repo

    return (
        <div>
            <div>
                <div className="repo-header-name">{repo.name}</div>
                <div className="repo-header-stars">Количество звезд: {repo.stargazers_count}</div>
            </div>
        </div>
    );
};

export default Repo;
